import neptuneImg from "../../src/assets/img/monstersAvatars/Neptune.png";

const monsters = [
  {
    id: 1,
    name: "Neptune",
    life: 100,
    img: neptuneImg,
    attack: 1,
    speed: 1,
    dodge: 5,
    accuracy: 1,
    armor: 1,
  },
];

export default monsters;
